const imgArr = [
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,'
]

function getRandomIndex(number) {
    return Math.floor(Math.random() * number)
}

export function getSomeList(arr) {
    return arr.map((item) => {
        delete item.id
        return {
            ...item,
            img: imgArr[getRandomIndex(imgArr.length)]
        }
    })
}
